package edu.gcccd.csis;

import org.junit.Assert;
import org.junit.Test;

import java.math.BigInteger;


public class FibonacciTest {

    @Test
    public void fibonacci() {
        Assert.assertEquals(Fibonacci.fibonacci(25), BigInteger.valueOf(75025L));
        Assert.assertEquals(Fibonacci.fibonacci(50), BigInteger.valueOf(12586269025L));
        Assert.assertEquals(Fibonacci.fibonacci(100), new BigInteger("354224848179261915075"));
        Assert.assertEquals(Fibonacci.fibonacci(500), new BigInteger("139423224561697880139724382870407283950070256587697307264108962948325571622863290691557658876222521294125"));
        Assert.assertEquals(Fibonacci.fibonacci(2000), new BigInteger(""));


    }
    @Test
    public void main() {

    }
}